import React from 'react';
import { Button, Card, Container, Row, Col } from 'react-bootstrap';
import './Home.css';
import background from './home-background.jpg';
import Header from '../../components/Header/Header.js';
import Footer from '../../components/Footer/Footer.js';

function Home()
{
    return (
        <div className="Home">
            <Container fluid>
                <Header />
                <Row className="Home-introduction">
                    <Col md={{ span: 3, offset: 9 }} className="Main-introduction">
                        We are here to provide <br />
                        guidance and support <br />
                        to mothers and families <br />
                        <Button variant="primary">Our Story</Button>
                    </Col>
                </Row>
                <Row className="Home-Mission">
                    <div className="Main-mission">
                        <h1>Mission Statement</h1>
                    </div>
                </Row>
                <Row>
                    <div className="Home-details">
                        <h1>Details</h1>
                    </div>
                </Row>
                <Footer />
            </Container>
        </div>
    );
}

export default Home;
